package com.jyp.greenhouse.core.entity;public class Adminroleadmin {    private static final String[] roles = {             "温室硬件管理员","日志管理员",             "自动控制参数管理员"    };    public static String[] getRoles() {        return roles;    }    private String adminid;    private String role;    public void setAdminid(String adminid) {        this.adminid = adminid;    }    public String getAdminid() {        return this.adminid;    }    public void setRole(String role) {        this.role = role;    }    public String getRole() {        return this.role;    }    @Override    public int hashCode() {        final int prime = 31;        int result = 1;        result = prime * result + ((role == null) ? 0 : role.hashCode());        return result;    }    @Override    public boolean equals(Object obj) {        if (this == obj)            return true;        if (obj == null)            return false;        if (getClass() != obj.getClass())            return false;        Adminroleadmin other = (Adminroleadmin) obj;        if (role == null) {            if (other.role != null)                return false;        } else if (!role.equals(other.role))            return false;        return true;    }}